function strEnc(data, firstKey, secondKey, thirdKey) {
    var leng = data.length;
    var encData = "";
    var firstKeyBt, secondKeyBt, thirdKeyBt, firstLength, secondLength, thirdLength;
    if (firstKey != null && firstKey != "") {
        firstKeyBt = getKeyBytes(firstKey);
        firstLength = firstKeyBt.length
    }
    if (secondKey != null && secondKey != "") {
        secondKeyBt = getKeyBytes(secondKey);
        secondLength = secondKeyBt.length
    }
    if (thirdKey != null && thirdKey != "") {
        thirdKeyBt = getKeyBytes(thirdKey);
        thirdLength = thirdKeyBt.length
    }
    if (leng > 0) {
        if (leng < 4) {
            var bt = strToBt(data);
            var encByte;
            if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "" && thirdKey != null && thirdKey != "") {
                var tempBt;
                var x, y, z;
                tempBt = bt;
                for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                for (z = 0; z < thirdLength; z++) { tempBt = enc(tempBt, thirdKeyBt[z]) }
                encByte = tempBt
            } else {
                if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "") {
                    var tempBt;
                    var x, y;
                    tempBt = bt;
                    for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                    for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                    encByte = tempBt
                } else {
                    if (firstKey != null && firstKey != "") {
                        var tempBt;
                        var x = 0;
                        tempBt = bt;
                        for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                        encByte = tempBt
                    }
                }
            }
            encData = bt64ToHex(encByte)
        } else {
            var iterator = parseInt(leng / 4);
            var remainder = leng % 4;
            var i = 0;
            for (i = 0; i < iterator; i++) {
                var tempData = data.substring(i * 4 + 0, i * 4 + 4);
                var tempByte = strToBt(tempData);
                var encByte;
                if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "" && thirdKey != null && thirdKey != "") {
                    var tempBt;
                    var x, y, z;
                    tempBt = tempByte;
                    for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                    for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                    for (z = 0; z < thirdLength; z++) { tempBt = enc(tempBt, thirdKeyBt[z]) }
                    encByte = tempBt
                } else {
                    if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "") {
                        var tempBt;
                        var x, y;
                        tempBt = tempByte;
                        for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                        for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                        encByte = tempBt
                    } else {
                        if (firstKey != null && firstKey != "") {
                            var tempBt;
                            var x;
                            tempBt = tempByte;
                            for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                            encByte = tempBt
                        }
                    }
                }
                encData += bt64ToHex(encByte)
            }
            if (remainder > 0) {
                var remainderData = data.substring(iterator * 4 + 0, leng);
                var tempByte = strToBt(remainderData);
                var encByte;
                if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "" && thirdKey != null && thirdKey != "") {
                    var tempBt;
                    var x, y, z;
                    tempBt = tempByte;
                    for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                    for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                    for (z = 0; z < thirdLength; z++) { tempBt = enc(tempBt, thirdKeyBt[z]) }
                    encByte = tempBt
                } else {
                    if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "") {
                        var tempBt;
                        var x, y;
                        tempBt = tempByte;
                        for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                        for (y = 0; y < secondLength; y++) { tempBt = enc(tempBt, secondKeyBt[y]) }
                        encByte = tempBt
                    } else {
                        if (firstKey != null && firstKey != "") {
                            var tempBt;
                            var x;
                            tempBt = tempByte;
                            for (x = 0; x < firstLength; x++) { tempBt = enc(tempBt, firstKeyBt[x]) }
                            encByte = tempBt
                        }
                    }
                }
                encData += bt64ToHex(encByte)
            }
        }
    }
    return encData
}

function strDec(data, firstKey, secondKey, thirdKey) {
    var leng = data.length;
    var decStr = "";
    var firstKeyBt, secondKeyBt, thirdKeyBt, firstLength, secondLength, thirdLength;
    if (firstKey != null && firstKey != "") {
        firstKeyBt = getKeyBytes(firstKey);
        firstLength = firstKeyBt.length
    }
    if (secondKey != null && secondKey != "") {
        secondKeyBt = getKeyBytes(secondKey);
        secondLength = secondKeyBt.length
    }
    if (thirdKey != null && thirdKey != "") {
        thirdKeyBt = getKeyBytes(thirdKey);
        thirdLength = thirdKeyBt.length
    }
    var iterator = parseInt(leng / 16);
    var i = 0;
    for (i = 0; i < iterator; i++) {
        var tempData = data.substring(i * 16 + 0, i * 16 + 16);
        var strByte = hexToBt64(tempData);
        var intByte = new Array(64);
        var j = 0;
        for (j = 0; j < 64; j++) { intByte[j] = parseInt(strByte.substring(j, j + 1)) }
        var decByte;
        if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "" && thirdKey != null && thirdKey != "") {
            var tempBt;
            var x, y, z;
            tempBt = intByte;
            for (x = thirdLength - 1; x >= 0; x--) { tempBt = dec(tempBt, thirdKeyBt[x]) }
            for (y = secondLength - 1; y >= 0; y--) { tempBt = dec(tempBt, secondKeyBt[y]) }
            for (z = firstLength - 1; z >= 0; z--) { tempBt = dec(tempBt, firstKeyBt[z]) }
            decByte = tempBt
        } else {
            if (firstKey != null && firstKey != "" && secondKey != null && secondKey != "") {
                var tempBt;
                var x, y, z;
                tempBt = intByte;
                for (x = secondLength - 1; x >= 0; x--) { tempBt = dec(tempBt, secondKeyBt[x]) }
                for (y = firstLength - 1; y >= 0; y--) { tempBt = dec(tempBt, firstKeyBt[y]) }
                decByte = tempBt
            } else {
                if (firstKey != null && firstKey != "") {
                    var tempBt;
                    var x, y, z;
                    tempBt = intByte;
                    for (x = firstLength - 1; x >= 0; x--) { tempBt = dec(tempBt, firstKeyBt[x]) }
                    decByte = tempBt
                }
            }
        }
        decStr += byteToString(decByte)
    }
    return decStr
}

function getKeyBytes(key) { var keyBytes = new Array(); var leng = key.length; var iterator = parseInt(leng / 4); var remainder = leng % 4; var i = 0; for (i = 0; i < iterator; i++) { keyBytes[i] = strToBt(key.substring(i * 4 + 0, i * 4 + 4)) } if (remainder > 0) { keyBytes[i] = strToBt(key.substring(i * 4 + 0, leng)) } return keyBytes }

function strToBt(str) {
    var leng = str.length;
    var bt = new Array(64);
    if (leng < 4) {
        var i = 0,
            j = 0,
            p = 0,
            q = 0;
        for (i = 0; i < leng; i++) {
            var k = str.charCodeAt(i);
            for (j = 0; j < 16; j++) {
                var pow = 1,
                    m = 0;
                for (m = 15; m > j; m--) { pow *= 2 }
                bt[16 * i + j] = parseInt(k / pow) % 2
            }
        }
        for (p = leng; p < 4; p++) {
            var k = 0;
            for (q = 0; q < 16; q++) {
                var pow = 1,
                    m = 0;
                for (m = 15; m > q; m--) { pow *= 2 }
                bt[16 * p + q] = parseInt(k / pow) % 2
            }
        }
    } else {
        for (i = 0; i < 4; i++) {
            var k = str.charCodeAt(i);
            for (j = 0; j < 16; j++) {
                var pow = 1;
                for (m = 15; m > j; m--) { pow *= 2 }
                bt[16 * i + j] = parseInt(k / pow) % 2
            }
        }
    }
    return bt
}

