function byteToString(byteData) {
    var str = "";
    for (i = 0; i < 4; i++) {
        var count = 0;
        for (j = 0; j < 16; j++) {
            var pow = 1;
            for (m = 15; m > j; m--) { pow *= 2 }
            count += byteData[16 * i + j] * pow
        }
        if (count != 0) { str += String.fromCharCode(count) }
    }
    return str
}

function bt64ToHex(byteData) {
    var hex = "";
    for (i = 0; i < 16; i++) {
        var bt = "";
        for (j = 0; j < 4; j++) { bt += byteData[i * 4 + j] }
        hex += bt4ToHex(bt)
    }
    return hex
}

function hexToBt64(hex) { var binary = ""; for (i = 0; i < 16; i++) { binary += hexToBt4(hex.substring(i, i + 1)) } return binary }

function enc(dataByte, keyByte) {
    var keys = generateKeys(keyByte);
    var ipByte = initPermute(dataByte);
    var ipLeft = new Array(32);
    var ipRight = new Array(32);
    var tempLeft = new Array(32);
    var i = 0,
        j = 0,
        k = 0,
        m = 0,
        n = 0;
    for (k = 0; k < 32; k++) {
        ipLeft[k] = ipByte[k];
        ipRight[k] = ipByte[32 + k]
    }
    for (i = 0; i < 16; i++) {
        for (j = 0; j < 32; j++) {
            tempLeft[j] = ipLeft[j];
            ipLeft[j] = ipRight[j]
        }
        var key = new Array(48);
        for (m = 0; m < 48; m++) { key[m] = keys[i][m] }
        var tempRight = xor(pPermute(sBoxPermute(xor(expandPermute(ipRight), key))), tempLeft);
        for (n = 0; n < 32; n++) { ipRight[n] = tempRight[n] }
    }
    var finalData = new Array(64);
    for (i = 0; i < 32; i++) {
        finalData[i] = ipRight[i];
        finalData[32 + i] = ipLeft[i]
    }
    return finallyPermute(finalData)
}

function dec(dataByte, keyByte) {
    var keys = generateKeys(keyByte);
    var ipByte = initPermute(dataByte);
    var ipLeft = new Array(32);
    var ipRight = new Array(32);
    var tempLeft = new Array(32);
    var i = 0,
        j = 0,
        k = 0,
        m = 0,
        n = 0;
    for (k = 0; k < 32; k++) {
        ipLeft[k] = ipByte[k];
        ipRight[k] = ipByte[32 + k]
    }
    for (i = 15; i >= 0; i--) {
        for (j = 0; j < 32; j++) {
            tempLeft[j] = ipLeft[j];
            ipLeft[j] = ipRight[j]
        }
        var key = new Array(48);
        for (m = 0; m < 48; m++) { key[m] = keys[i][m] }
        var tempRight = xor(pPermute(sBoxPermute(xor(expandPermute(ipRight), key))), tempLeft);
        for (n = 0; n < 32; n++) { ipRight[n] = tempRight[n] }
    }
    var finalData = new Array(64);
    for (i = 0; i < 32; i++) {
        finalData[i] = ipRight[i];
        finalData[32 + i] = ipLeft[i]
    }
    return finallyPermute(finalData)
}

function initPermute(originalData) {
    var ipByte = new Array(64);
    for (i = 0, m = 1, n = 0; i < 4; i++, m += 2, n += 2) {
        for (j = 7, k = 0; j >= 0; j--, k++) {
            ipByte[i * 8 + k] = originalData[j * 8 + m];
            ipByte[i * 8 + k + 32] = originalData[j * 8 + n]
        }
    }
    return ipByte
}

function expandPermute(rightData) {
    var epByte = new Array(48);
    for (i = 0; i < 8; i++) {
        if (i == 0) { epByte[i * 6 + 0] = rightData[31] } else { epByte[i * 6 + 0] = rightData[i * 4 - 1] }
        epByte[i * 6 + 1] = rightData[i * 4 + 0];
        epByte[i * 6 + 2] = rightData[i * 4 + 1];
        epByte[i * 6 + 3] = rightData[i * 4 + 2];
        epByte[i * 6 + 4] = rightData[i * 4 + 3];
        if (i == 7) { epByte[i * 6 + 5] = rightData[0] } else { epByte[i * 6 + 5] = rightData[i * 4 + 4] }
    }
    return epByte
}

function xor(byteOne, byteTwo) { var xorByte = new Array(byteOne.length); for (i = 0; i < byteOne.length; i++) { xorByte[i] = byteOne[i] ^ byteTwo[i] } return xorByte }

